function getSubmatrix(startRow, endRow, startCol, endCol) {
    let submatrix = [];
    for (let i = startRow; i <= endRow; i++) {
        let row = [];
        for (let j = startCol; j <= endCol; j++) {
            row.push(board[i][j]);
        }
        submatrix.push(row);
    }
    return submatrix;
}

const matrices = [
    getSubmatrix(0, 2, 0, 5),
    getSubmatrix(0, 2, 6, 11),
    getSubmatrix(3, 5, 0, 5),
    getSubmatrix(3, 5, 6, 11),
    getSubmatrix(6, 8, 0, 5),
    getSubmatrix(6, 8, 6, 11)
];

function rotate(boardPiece){
    // Swap first and last rows
    let temp = boardPiece[0];
    boardPiece[0] = boardPiece[boardPiece.length - 1];
    boardPiece[boardPiece.length - 1] = temp;
    // Reverse the order of elements in each row
    for (let row of boardPiece) {
        row.reverse();
    }
    return boardPiece;
}

function mergeMatricesByRows(matrix1, matrix2) {
    if (matrix1.length !== matrix2.length) {
        throw new Error("Matrices must have the same number of rows.");
    }

    let mergedMatrix = [];
    for (let i = 0; i < matrix1.length; i++) {
        mergedMatrix.push(matrix1[i].concat(matrix2[i]));
    }

    return mergedMatrix;
}



function board_layout(boardConfig){
    const order = boardConfig.tiles;
    const rotation = boardConfig.rotations;
    let pieces = matrices;
    
    
    for (let j=0;j<rotation.length;j++){
        if (rotation[j]>5){
            rotate(pieces[order[j]-1]);
        }
    }


    let rearrangedBoard=mergeMatricesByRows(pieces[order[0]-1],pieces[order[1]-1]);
    for (let k=0;k<3;k++){
        rearrangedBoard.push(mergeMatricesByRows(pieces[order[2]-1],pieces[order[3]-1])[k]);    
    }
    for (let k=0;k<3;k++){
        rearrangedBoard.push(mergeMatricesByRows(pieces[order[4]-1],pieces[order[5]-1])[k]);    
    }
    
    return rearrangedBoard;
}

